import '../../assets/webStyles/temporalPt.css'

function TemporalView(){
    return(
        <div className="Main-view">
            <div className='Info-containerTp'>
                <div className="Text-contentTp">
                    <p>Esta sección aún está en construcción.<br></br> 
                        Muy pronto estará disponible para ti.
                    </p>
                </div>
                <div className='Email-textTp'>
                    <p>Déjanos tu correo y te avisaremos cuando esté disponible</p>
                </div>
            </div>
        </div>
    );
}
export default TemporalView;
